description:
bán nhà 4 tầng, diện tích đất 90m2 (4,5x2) lô góc, ô tô đõ cửa ngày đêm tại trung lực
nhà bố trí bao gồm: phòng khách, phòng bếp, 4 phòng ngủ, 4 vệ sinh, phòng thờ, sân phơi;
hướng: bắc (đông tt);
pháp lý: sổ đỏ chính chủ;
nhà có vị trí gần trường học các cấp, chợ đằng lâm, ubnd phường...tiện ích đầy đủ...
giá bán: 8,3 tỷ (có thoả thuận);
